import { StyleSheet, Dimensions } from "react-native";
const width = Dimensions.get('window').width;

const styles = StyleSheet.create({
    container: {
      alignItems: "center",
      alignSelf: 'stretch',
      flexWrap: 'wrap'
    },
    container2: {
      backgroundColor: '#02121B',
      height: 2,
      marginTop: 1    
    },
    logo: {
      height: 85,
      width: 85,
    }
  });

export default styles
